/* Load input file from disk into memory. */
wchar_t *LoadInputFile(char *FileName)
{
	FILE *Fin;
	char *Buf1;
	wchar_t *Buf2;
	struct stat statbuf;
	size_t BytesRead;
	unsigned long i;

	/* Sanity check. */
	if ((FileName == NULL) || (*FileName == '\0'))
		return NULL;

	/* Open the file. */
	Fin = fopen(FileName,"rb");
	if (Fin == NULL)
	{
		fprintf(stderr,"Could not open input file: %s\n",FileName);
		return NULL;
	}

	/* Get the size of the file. */
	if (fstat(fileno(Fin),&statbuf) != 0)
	{
		fprintf(stderr,"Could not stat() the input file: %s\n",FileName);
		fclose(Fin);
		return NULL;
	}

	/* Allocate memory for the input. */
	Buf1 = (char *)malloc(statbuf.st_size + 1);
	Buf2 = (wchar_t *)malloc(sizeof(wchar_t) * (statbuf.st_size + 1));
	if ((Buf1 == NULL) || (Buf2 == NULL))
	{
		fprintf(stderr,"Not enough memory to load the file: %s\n",FileName);
		fclose(Fin);
		if (Buf1 != NULL) free(Buf1);
		if (Buf2 != NULL) free(Buf2);
		return NULL;
	}

	/* Load the file into memory. */
	BytesRead = fread(Buf1,1,statbuf.st_size,Fin);
	Buf1[BytesRead] = '\0';

	/* Close the file. */
	fclose(Fin);

	/* Exit if there was an error while reading the file. */
	if (BytesRead != (size_t)statbuf.st_size)
	{
		fprintf(stdout,"Error while reading input file: %s\n",FileName);
		free(Buf1);
		free(Buf2);
		return NULL;
	}

	/* Convert from ASCII to Unicode. */
	for (i = 0; i <= BytesRead; i++)
		Buf2[i] = Buf1[i];
	free(Buf1);

	return(Buf2);
}




void ShowErrorMessage(struct TokenStruct *Token, int Result)
{
	int Symbol;
	int i;
	wchar_t s1[BUFSIZ];

	switch(Result)
	{
		case PARSELEXICALERROR:
			fprintf(stderr,"Lexical error");
			break;
		case PARSECOMMENTERROR:
			fprintf(stderr,"Comment error");
			break;
		case PARSETOKENERROR:
			fprintf(stderr,"Tokenizer error");
			break;
		case PARSESYNTAXERROR:
			fprintf(stderr,"Syntax error");
			break;
		case PARSEMEMORYERROR:
			fprintf(stderr,"Out of memory");
			break;
	}
	if (Token != NULL)
		fprintf(stderr," at line %ld column %ld",Token->Line,Token->Column);
	fprintf(stderr,".\n");

	if (Result == PARSELEXICALERROR)
	{
		if (Token->Data != NULL)
		{
			ReadableString(Token->Data,s1,BUFSIZ);
			fprintf(stderr,"The grammar does not specify what to do with '%S'.\n",s1);
		}
		else
		{
			fprintf(stderr,"The grammar does not specify what to do.\n");
		}
	}
	if (Result == PARSETOKENERROR)
	{
		fprintf(stderr,"The tokenizer returned a non-terminal.\n");
	}
	if (Result == PARSECOMMENTERROR)
	{
		fprintf(stderr,"The comment has no end, it was started but not finished.\n");
	}
	if (Result == PARSESYNTAXERROR)
	{
		if (Token->Data != NULL)
		{
			ReadableString(Token->Data,s1,BUFSIZ);
			fprintf(stderr,"Encountered '%S', but expected ",s1);
		}
		else
		{
			fprintf(stderr,"Expected ");
		}
		for (i = 0; i < Grammar.LalrArray[Token->Symbol].ActionCount; i++)
		{
			Symbol = Grammar.LalrArray[Token->Symbol].Actions[i].Entry;
			if (Grammar.SymbolArray[Symbol].Kind == SYMBOLTERMINAL)
			{
				if (i > 0)
				{
					fprintf(stderr,", ");
					if (i >= Grammar.LalrArray[Token->Symbol].ActionCount - 2)
						fprintf(stderr,"or ");
				}
				fprintf(stderr,"'%S'",Grammar.SymbolArray[Symbol].Name);
			}
		}
		fprintf(stderr,".\n");
	}
}


int parseFile(int argc, char *argv[])
{
	wchar_t *InputBuf;
	struct TokenStruct *Token;
	struct ContextStruct Context;
	int Result;

	if (argc < 3)
	{
		fprintf(stderr, "Usage: %s <input file> <output file>", argv[0]);
		return 1;
	}

	/* Load the inputfile into memory. */
	InputBuf = LoadInputFile(argv[1]);
	if (InputBuf == NULL)
	{
		fprintf(stderr, "\"%s\" could not be opened.", argv[1]);
		return 1;
	}

	/* Open the outputfile for writing. */
	FILE* outFile = fopen(argv[2], "w");
	if (outFile == NULL)
	{
		fprintf(stderr, "\"%s\" could not be opened for writing.", argv[2]);
		return 1;
	}

	/* Run the Parser. */
	Result = Parse(InputBuf,wcslen(InputBuf),TRIMREDUCTIONS,DEBUG,&Token);

	/* Interpret the results. */
	if (Result != PARSEACCEPT)
	{
		ShowErrorMessage(Token,Result);
	}
	else
	{
		/* Initialize the Context. */
		Context.Debug = DEBUG;
		Context.Indent = 0;
		Context.ReturnValue = NULL;
		Context.out = outFile;

		/* Start execution by calling the subroutine of the first Token on
		   the TokenStack. It's the "Start Symbol" that is defined in the
		   grammar. */
		RuleJumpTable[Token->ReductionRule](Token,&Context);
	}

	/* Cleanup. */
	DeleteTokens(Token);
	free(InputBuf);
	fclose(outFile);
	return 0;
}
